import React from "react";

import TitleBasic from "../../components/man/TitleBasic";

import AsImg from "../../assets/man/as_navy.png";

const AsPage = () => {
  return (
    <div className="AsContainer">
      <div className="topAs">
        <TitleBasic imgSrc={AsImg} title="A/S 수리 현황 관리" />
      </div>

      <div className="middleAs">
        <div className="boxAs">
          <div className="RequestAs"></div>
        </div>
      </div>
      <div className="bottomAs"></div>
    </div>
  );
};

export default AsPage;
